import { FaArrowRight } from "react-icons/fa";
import "./HistoryTableRow.css";

const HistoryTableRow = ({ order }) => {
  // Render component
  return (
    <div className="row history-table__row">
      <h6 className="col-2 d-none d-lg-block">{order._id}</h6>
      <h6 className="col-2 d-none d-lg-block">{order.user._id}</h6>
      <h6 className="col-3 col-md-2">{order.receiver.full_name}</h6>
      <h6 className="col-2 col-lg-1 d-none d-md-block">{order.receiver.phone_number}</h6>
      <h6 className="col-3 col-lg-1 col-md-2">{order.receiver.address}</h6>
      <h6 className="col-3 col-md-1">{order.total_price}</h6>
      <h6 className="col-2 col-lg-1 d-none d-md-block">{order.delivered ? "Delivered" : "Waiting for progressing"}</h6>
      <h6 className="col-1 d-none d-md-block">{order.paid ? "Waiting for pay" : "Paid"}</h6>
      <h6 className="col-3 col-lg-1 col-md-2">
        <button className="history-remove-btn">
          View <FaArrowRight />
        </button>
      </h6>
    </div>
  );
};

export default HistoryTableRow;
